,helvetica neue,sans-serif\">Здравствуйте! </span></strong></p>\r\n\r\n<p><span style=\"color:rgb(0, 0, 0); font-family:-apple-system,blinkmacsystemfont,roboto,open sans,helvetica neue,sans-serif\"><strong>Наш склад переехал на новый адрес: Москва, Проектируемый проезд № 134. Рядом с рынком &quot;Славянский мир&quot;. Заезд с Киевского или Калужского шоссе, повернуть в сторону Хованского кладбища, далее на светофоре с улицы Адмирала Корнилова повернуть на проектируемый проезд №134, слева будет заезд на территорию через автоматический шлагбаум. Дальше корпус 10, склад 6.</strong> </span></p>\r\n\r\n<p><span style=\"color:#0000FF\"><span style=\"font-family:-apple-system,blinkmacsystemfont,roboto,open sans,helvetica neue,sans-serif\">С уважением TEDTRANS | Босфор Логистика.</span></span></p>\r\n', 1),
