bsp;получить его в&nbsp;удобное рабочее&nbsp;время на складе или заказать доставку.</p>\r\n\r\n<p>При нахождении груза более 5-ти&nbsp;суток на нашем&nbsp;складе в&nbsp;Москве, хранение тарифицируется по 0,50 рублей за 1 кг груза в сутки&nbsp;за каждый календарный день&nbsp;.</p>\r\n\r\n<p>Минимальная стоимость&nbsp; хранения&nbsp;&mdash; 100&nbsp;руб. в&nbsp;сутки.</p>\r\n\r\n<p>2) Дополнительная разбивка груза, при отгрузки двум различным грузополучателям на складе в Москве бесплатна . Начиная с 3-го грузополучателя включительно, за каждого последующего грузополучателя разбивка груза по партиям тарифицируется по 200 рублей за&nbsp;каждого дополнительного&nbsp;грузополучателя.</p>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<div>&nbsp;</div>\r\n', 1),
